import { useEffect, useState } from "react";
import { useParams } from "react-router-dom";
import HOST from "../Setup";

function viewProfessorDetails(props) {
  const professor = props.professor;
  return (
    <div>
      <h3>
        {professor.firstname} {professor.lastname}, {professor.academicTitle}
      </h3>
    </div>
  );
}

function ProfessorDetails(props) {
  const [professorDetails, setProfessorDetails] = useState(null);
  const [loading, setLoading] = useState(true);
  const { id } = useParams();

  useEffect(() => {
    let url = HOST + "/professors/" + id;

    console.log(url);

    fetch(url)
      .then((response) => {
        response.json().then((result) => {
          setProfessorDetails(result);
          console.log(professorDetails);
        });
      })
      .finally(() => {
        setLoading(false);
      });
  }, []);

  return (
    <div>
      <h3>{professorDetails && professorDetails.lastname}</h3>
    </div>
  );
}

export default ProfessorDetails;
